INSERT INTO `cache_filter` VALUES ('1:9740d458aecec45ed1a63d574a503614','<p>1. Introduction</p>\n<p>Online community sites (weblogs, message boards, wikis, etc.) have replaced the traditional means of keeping a community informed via libraries and publishing. They are a valuable source of information and quite often it is a community site where you will end up when searching for some information. But there is a problem: online community sites are like islands without bridges connecting them. You may find some information in a forum, but not know that there are missing pieces of related information that can be found on other community sites.</p>\n',1211990899,1211904499,''),('1:d41d8cd98f00b204e9800998ecf8427e','',1211990899,1211904499,''),('1:9d3b9521092dd5205132b8bdb6442010','<p>A bowler that participates in this game</p>\n',1211990902,1211904502,''),('1:f02d9fca116143f1558d32a3875581f7','<p>1. Introduction</p>\n<p>Online community sites (weblogs, message boards, wikis, etc.) have replaced the traditional means of keeping a community informed via libraries and publishing. They are a valuable source of information and quite often it is a community site where you will end up when searching for some information. But there is a problem: online community sites are like islands without bridges connecting them. You may find some information in a forum, but not know that there are missing pieces of related information that can be found on other community sites.</p>\n<p>Semantically-Interlinked Online Communities, or SIOC, is an attempt to link online community sites, to use Semantic Web technologies to describe the information that communities have about their structure and contents, and to find related information and new connections between content items and other community objects. SIOC is based around the use of machine-readable information provided by these sites.</p>\n<p>The SIOC Core Ontology described in this document is the foundation for Semantically-Interlinked Online Communities. Developers can use this ontology to express information contained within community sites in a simple and extensible way.</p>\n<p>More information about the tools and projects using SIOC can be found on the SIOC Project page (<a href=\"http://sioc-project.org/\" title=\"http://sioc-project.org/\">http://sioc-project.org/</a>).</p>\n<p>1.1. Terminology and notation</p>\n<p>The keywords \"MUST\", \"MUST NOT\", \"REQUIRED\", \"SHALL\", \"SHALL NOT\", \"SHOULD\", \"SHOULD NOT\", \"RECOMMENDED\", \"MAY\", and \"OPTIONAL\" in this document are to be interpreted as described in RFC 2119.</p>\n<p>Namespace URIs of the general form \"http://www.example.com/\" represent some application-dependent or context-dependent URI as defined in RFC 2396.</p>\n<p>The XML Namespace URIs that MUST be used by implementations of this specification are:</p>\n<p>    * <a href=\"http://rdfs.org/sioc/ns#\" title=\"http://rdfs.org/sioc/ns#\">http://rdfs.org/sioc/ns#</a> - SIOC Core Ontology Namespace<br />\n    * <a href=\"http://rdfs.org/sioc/types#\" title=\"http://rdfs.org/sioc/types#\">http://rdfs.org/sioc/types#</a> - SIOC Types Ontology Module Namespace<br />\n    * <a href=\"http://rdfs.org/sioc/services#\" title=\"http://rdfs.org/sioc/services#\">http://rdfs.org/sioc/services#</a> - SIOC Services Ontology Module Namespace</p>\n',1212111045,1212024645,''),('1:e01117e9e439e8f86d3742cfa6b2f1ed','<p>A Community may consist of different types of objects (people, sites, etc.) joined by a common topic, interests or goals.</p>\n<p>A Community is different from a Site: a Site describes a single community site whilst a Community can consist of a number of Sites and other resources described in SIOC or other ontologies (e.g., FOAF). Community is linked to its constituent parts using the property dcterms:hasPart.  <a href=\"test.com\">Test link</a></p>\n',1212111194,1212024794,''),('1:07131b6667d38606a90096543e7bd898','<p>Container is a high-level concept used to group content Items together. The relationships between a Container and the Items that belong to it are described using sioc:container_of and sioc:has_container properties. A hierarchy of Containers can be defined in terms of parents and children using sioc:has_parent and sioc:parent_of.</p>\n',1212111194,1212024794,''),('1:59abf80b8c7d1ec6dedcdacd90309fd9','<p>Container is a high-level concept used to group content Items together. The relationships between a Container and the Items that belong to it are described using sioc:container_of and sioc:has_container properties. A hierarchy of Containers can be defined in terms of parents and children using sioc:has_parent and sioc:parent_of.</p>\n<p>Subclasses of Container can be used to further specify typed groupings of Items in online communities. Forum, a subclass of Container and one of the core classes in SIOC, is used to describe an area on a community Site (e.g., a forum or weblog) on which Posts are made. The SIOC Types Ontology Module contains additional, more specific subclasses of sioc:Container.</p>\n',1212246174,1212159774,'');
