INSERT INTO `node_revisions` VALUES (71,71,1,'bowling','','','',1208094007,1),(72,72,1,'Bowler','','','',1208430683,1),(73,73,2,'Game','','','',1205530270,1),(74,74,2,'LeagueGame','','','',1205530299,1),(75,75,1,'plays','','','',1208430757,1),(76,76,2,'hasPlayer','A bowler that participates in this game','A bowler that participates in this game','',1205530394,1),(77,77,1,'Team','','','',1205542961,1),(78,78,1,'hasMember','','','',1205543587,1),(79,79,1,'Tournament','','','',1205543207,1),(80,80,1,'participatesIn','','','',1205543244,1),(81,81,1,'consistsOf','','','',1205543635,1),(83,83,1,'SIOC','1. Introduction\r\n\r\nOnline community sites (weblogs, message boards, wikis, etc.) have replaced the traditional means of keeping a community informed via libraries and publishing. They are a valuable source of information and quite often it is a community site where you will end up when searching for some information. But there is a problem: online community sites are like islands without bridges connecting them. You may find some information in a forum, but not know that there are missing pieces of related information that can be found on other community sites.\r\n\r\nSemantically-Interlinked Online Communities, or SIOC, is an attempt to link online community sites, to use Semantic Web technologies to describe the information that communities have about their structure and contents, and to find related information and new connections between content items and other community objects. SIOC is based around the use of machine-readable information provided by these sites.\r\n\r\nThe SIOC Core Ontology described in this document is the foundation for Semantically-Interlinked Online Communities. Developers can use this ontology to express information contained within community sites in a simple and extensible way.\r\n\r\nMore information about the tools and projects using SIOC can be found on the SIOC Project page (http://sioc-project.org/).\r\n\r\n\r\n1.1. Terminology and notation\r\n\r\nThe keywords \"MUST\", \"MUST NOT\", \"REQUIRED\", \"SHALL\", \"SHALL NOT\", \"SHOULD\", \"SHOULD NOT\", \"RECOMMENDED\", \"MAY\", and \"OPTIONAL\" in this document are to be interpreted as described in RFC 2119.\r\n\r\nNamespace URIs of the general form \"http://www.example.com/\" represent some application-dependent or context-dependent URI as defined in RFC 2396.\r\n\r\nThe XML Namespace URIs that MUST be used by implementations of this specification are:\r\n\r\n    * http://rdfs.org/sioc/ns# - SIOC Core Ontology Namespace\r\n    * http://rdfs.org/sioc/types# - SIOC Types Ontology Module Namespace\r\n    * http://rdfs.org/sioc/services# - SIOC Services Ontology Module Namespace\r\n','1. Introduction\r\n\r\nOnline community sites (weblogs, message boards, wikis, etc.) have replaced the traditional means of keeping a community informed via libraries and publishing. They are a valuable source of information and quite often it is a community site where you will end up when searching for some information. But there is a problem: online community sites are like islands without bridges connecting them. You may find some information in a forum, but not know that there are missing pieces of related information that can be found on other community sites.\r\n\r','initial version',1211412612,1),(84,84,1,'Community','A Community may consist of different types of objects (people, sites, etc.) joined by a common topic, interests or goals.\r\n\r\nA Community is different from a Site: a Site describes a single community site whilst a Community can consist of a number of Sites and other resources described in SIOC or other ontologies (e.g., FOAF). Community is linked to its constituent parts using the property dcterms:hasPart.  <a href=\"test.com\">Test link</a>','A Community may consist of different types of objects (people, sites, etc.) joined by a common topic, interests or goals.\r\n\r\nA Community is different from a Site: a Site describes a single community site whilst a Community can consist of a number of Sites and other resources described in SIOC or other ontologies (e.g., FOAF). Community is linked to its constituent parts using the property dcterms:hasPart.  <a href=\"test.com\">Test link</a>','',1208277558,1),(85,85,1,'Container','Container is a high-level concept used to group content Items together. The relationships between a Container and the Items that belong to it are described using sioc:container_of and sioc:has_container properties. A hierarchy of Containers can be defined in terms of parents and children using sioc:has_parent and sioc:parent_of.\r\n\r\nSubclasses of Container can be used to further specify typed groupings of Items in online communities. Forum, a subclass of Container and one of the core classes in SIOC, is used to describe an area on a community Site (e.g., a forum or weblog) on which Posts are made. The SIOC Types Ontology Module contains additional, more specific subclasses of sioc:Container. ','Container is a high-level concept used to group content Items together. The relationships between a Container and the Items that belong to it are described using sioc:container_of and sioc:has_container properties. A hierarchy of Containers can be defined in terms of parents and children using sioc:has_parent and sioc:parent_of.\r\n\r','',1208258599,1),(90,90,1,'Item','','','',1208256362,1),(89,89,1,'Forum','','','',1208256310,1),(91,91,1,'Post','','','',1208256513,1),(92,92,1,'User','','','',1208256568,1),(93,93,1,'has_container','','','',1208256701,1),(94,94,1,'has_creator','','','',1208266319,1),(95,95,1,'Site','','','',1208265492,1),(96,96,1,'has_host','','','',1208265351,1),(97,97,1,'Space','','','',1208265990,1),(98,98,1,'has_space','','','',1208266029,1),(99,99,1,'Usergroup','','','',1208266208,1),(100,100,1,'has_member','','','',1208266226,1),(101,101,1,'has_reply','','','',1208266378,1),(106,106,1,'won','','','',1211906857,1),(107,107,1,'winner','','','',1211906948,1);
